import React from 'react';
import classNames from 'classnames';
import { Link } from 'react-router-dom';
import Image from '../../elements/Image';
import footerLogo from '../../../assets/images/MyntInvest-f.png';
const Logo = ({
  className,
  ...props
}) => {

  const classes = classNames(
    'brand',
    className
  );

  return (
    <div
      {...props}
      className={classes}
    >


         <img src={footerLogo} /> 


    </div>
  );
}

export default Logo;
